import React from 'react';
import { Box, Typography, Grid, makeStyles, Card, CardMedia, CardContent, Paper } from '@material-ui/core';
import { blue } from '@material-ui/core/colors';
import { ExtraHeaderData } from './ExtraHeaderData';

const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" },
    icon: { fontSize: "5rem", color: blue[500] }
}))

const ExtraHeaderSection = () => {
    const classes = useStyles();
    return (
        <>
            <section>
                <Box className="container-fluid my-3">
                    <Grid container>
                        <Grid item xl={10} md={11} xs={12} className={classes.margin}>
                            <Box>
                                <Grid container spacing={5}>
                                    {ExtraHeaderData.map((item, index) => {
                                        return (<Grid item md={4} sm={12} key={index}>
                                            <Paper>
                                                <Card component={Card}>
                                                    <CardMedia>
                                                        <i className={item.cardMedia, classes.icon}></i>
                                                    </CardMedia>
                                                    <CardContent>
                                                        <Typography align="center" variant="h6" color="primary" gutterBottom>{item.cardTitle}</Typography>
                                                        <Typography align="center" variant="subtitle1">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Suscipit placeat molestiae ut repellendus obcaecati neque soluta. Aliquid, officia!</Typography>
                                                    </CardContent>
                                                </Card>
                                            </Paper>
                                        </Grid>)
                                    })}
                                </Grid>
                            </Box>
                        </Grid>
                    </Grid>
                </Box>
            </section>
        </>
    )
}

export default ExtraHeaderSection;
